            <span
                class="absolute inset-0 transition-transform translate-x-0.5 translate-y-0.5 bg-bg-SkyDark group-hover:translate-y-0 group-hover:translate-x-0"
            ></span>

                    <span class="relative block px-8 py-3 bg-[#1A2238] border border-current">
              <Link to="/">Go Home</Link>
            </span>
                </a>
            </button>
        </div>
    );
}

export default NotFound;
